import React, { Component } from "react";
import { Carousel } from "react-bootstrap";

class Reception extends Component {
  state = {};
  render() {
    return (
      <Carousel>
        <Carousel.Item>
          <img src={require("../imgs/slide-1.png")} alt="" />
        </Carousel.Item>
        <Carousel.Item>
          <img src={require("../imgs/slide-2.png")} alt="" />
        </Carousel.Item>
        <Carousel.Item>
          <img src={require("../imgs/slide-3.png")} alt="" />
        </Carousel.Item>
        <Carousel.Item>
          <img src={require("../imgs/slide-4.png")} alt="" />
        </Carousel.Item>
        <Carousel.Item>
          <img src={require("../imgs/slide-5.png")} alt="" />
        </Carousel.Item>
      </Carousel>
    );
  }
}

export default Reception;
